      **Population density** refers to the number of people living per unit of area,
      typically per square mile or square kilometer. It''s calculated by dividing
      the total population of an area by its total land area. A higher population
      density means more people are living in a smaller space, while a lower density
      indicates fewer people spread over a larger area.


